import React, { Component } from 'react'
import axios from 'axios'

const api = axios.create({
    baseURL: "https://localhost:5001/"
})

class userService extends Component() {
    constructor(){
        super();
        api.get("/").then(res => {
            console.log(res.data)
        })
    }
}
